import styled from "styled-components";

export const FormStyled = styled.form`
    display: flex;
    flex-direction: column;
    gap: 25px;
    border: 2px solid #999999;
    
    div:first-child {
        display: flex;
        flex-direction: row;
        align-items: center;
        justify-content: space-between;
        padding: 30px 25px;
    }
`
